import React from "react";
import logo from "../static/twitter-icon-svg.jpg";
import styles from "../static/css/App.module.css";

const SideBar = () => {
  return (
    <div
      className="hidden sm:flex flex-col items-center xl:items-start
    xl:w-[340px] p-2 fixed h-full"
    >
      <div className="flex items-center justify-center w-14 h-14 p-0 xl:ml-24 hover:bg-[#d9d9d9] hover:bg-opacity-25 rounded-full cursor-pointer transition duration-200 xl:py-1 xl:px-3">
        <img src={logo} alt="Logo" />;
      </div>
    </div>
  );
};

export default SideBar;
